import React, { useState } from 'react';
import { fetchData } from '../api';
import { TextField, MenuItem, Button, Container, Typography, Paper, Box, Dialog, DialogTitle, DialogContent, DialogActions } from '@mui/material';
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

const HealthForm = () => {
    const [formData, setFormData] = useState({
        age: '',
        height: '',
        weight: '',
        activityLevel: '',
        gender: '',  // 'M' für Männlich, 'W' für Weiblich
        dailyWaterIntake: '',
        sleepHours: '',
        stressLevel: '',
    });

    const [recommendations, setRecommendations] = useState([]);
    const [dialogOpen, setDialogOpen] = useState(false);

    const handleChange = (name, value) => {
        setFormData({
            ...formData,
            [name]: value
        });
    };

    const handleSubmit = async () => {
        // Logische Einschränkungen
        if (formData.age < 1 || formData.age > 120) {
            toast.error('Bitte geben Sie ein gültiges Alter ein (1-120 Jahre).');
            return;
        }
        if (formData.height < 50 || formData.height > 250) {
            toast.error('Bitte geben Sie eine gültige Größe ein (50-250 cm).');
            return;
        }
        if (formData.weight < 10 || formData.weight > 300) {
            toast.error('Bitte geben Sie ein gültiges Gewicht ein (10-300 kg).');
            return;
        }
        if (formData.activityLevel < 1 || formData.activityLevel > 5) {
            toast.error('Bitte geben Sie ein gültiges Aktivitätslevel ein (1-5).');
            return;
        }
        if (formData.dailyWaterIntake < 1 || formData.dailyWaterIntake > 20) {
            toast.error('Bitte geben Sie eine gültige tägliche Wasseraufnahme ein (1-20 Gläser).');
            return;
        }
        if (formData.sleepHours < 1 || formData.sleepHours > 24) {
            toast.error('Bitte geben Sie eine gültige Anzahl an Schlafstunden ein (1-24 Stunden).');
            return;
        }
        if (formData.stressLevel < 1 || formData.stressLevel > 10) {
            toast.error('Bitte geben Sie ein gültiges Stresslevel ein (1-10).');
            return;
        }

        const data = await fetchData('/predict', formData);
        toast.success('Daten erfolgreich gesendet!');
        setRecommendations(data);  // Empfehlungen speichern
        setDialogOpen(true);  // Dialog öffnen
    };

    const handleClose = () => {
        setDialogOpen(false);
    };

    return (
        <Container maxWidth="sm">
            <Paper elevation={3} style={styles.paper}>
                <Box p={3}>
                    <Typography variant="h4" align="center" gutterBottom style={styles.header}>
                        Health Assessment Form
                    </Typography>
                    <TextField
                        fullWidth
                        label="Alter"
                        type="number"
                        variant="outlined"
                        margin="normal"
                        value={formData.age}
                        onChange={e => handleChange('age', e.target.value)}
                    />
                    <TextField
                        fullWidth
                        label="Größe (cm)"
                        type="number"
                        variant="outlined"
                        margin="normal"
                        value={formData.height}
                        onChange={e => handleChange('height', e.target.value)}
                    />
                    <TextField
                        fullWidth
                        label="Gewicht (kg)"
                        type="number"
                        variant="outlined"
                        margin="normal"
                        value={formData.weight}
                        onChange={e => handleChange('weight', e.target.value)}
                    />
                    <TextField
                        fullWidth
                        label="Aktivitätslevel (1-5)"
                        type="number"
                        variant="outlined"
                        margin="normal"
                        value={formData.activityLevel}
                        onChange={e => handleChange('activityLevel', e.target.value)}
                    />
                    <TextField
                        select
                        fullWidth
                        label="Geschlecht"
                        variant="outlined"
                        margin="normal"
                        value={formData.gender}
                        onChange={e => handleChange('gender', e.target.value)}
                    >
                        <MenuItem value="M">Männlich</MenuItem>
                        <MenuItem value="W">Weiblich</MenuItem>
                    </TextField>
                    <TextField
                        fullWidth
                        label="Tägliche Wasseraufnahme (Gläser)"
                        type="number"
                        variant="outlined"
                        margin="normal"
                        value={formData.dailyWaterIntake}
                        onChange={e => handleChange('dailyWaterIntake', e.target.value)}
                    />
                    <TextField
                        fullWidth
                        label="Schlafstunden"
                        type="number"
                        variant="outlined"
                        margin="normal"
                        value={formData.sleepHours}
                        onChange={e => handleChange('sleepHours', e.target.value)}
                    />
                    <TextField
                        fullWidth
                        label="Stresslevel (1-10)"
                        type="number"
                        variant="outlined"
                        margin="normal"
                        value={formData.stressLevel}
                        onChange={e => handleChange('stressLevel', e.target.value)}
                    />
                    <Button
                        fullWidth
                        variant="contained"
                        color="primary"
                        style={styles.button}
                        onClick={handleSubmit}
                    >
                        Absenden
                    </Button>
                </Box>
            </Paper>
            <Dialog open={dialogOpen} onClose={handleClose}>
                <DialogTitle>Ihre Gesundheitsempfehlungen</DialogTitle>
                <DialogContent>
                    <ul>
                        {recommendations.map((rec, index) => (
                            <li key={index}>{rec}</li>
                        ))}
                    </ul>
                </DialogContent>
                <DialogActions>
                    <Button onClick={handleClose} color="primary">
                        Schließen
                    </Button>
                </DialogActions>
            </Dialog>
            <ToastContainer />
        </Container>
    );
};

const styles = {
    paper: {
        padding: '30px',
        borderRadius: '15px',
    },
    header: {
        color: '#007bff',
        fontWeight: 'bold',
    },
    button: {
        marginTop: '20px',
        padding: '10px',
        fontSize: '18px',
    },
};

export default HealthForm;
